import './App.css';
import React from 'react';
import router from './router/index'; // Importez le composant router correctement
import { BrowserRouter } from 'react-router-dom'; 

function App() {
  return (
    <div>
      <BrowserRouter>
        {router}
      </BrowserRouter>
    </div>
  );
}

export default App;
